INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190804, 60000, 1, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", "", 0, 0, 1, 1, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, 60000, 2, 2, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, 60000, 2, 3, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, 60000, 2, 4, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", "", 0, 0, 2, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, 60000, 2, 5, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, 60000, 2, 6, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, 60000, 2, 7, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", "", 0, 0, 2, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60000, 2, 8, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60000, 2, 9, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60000, 2, 10, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60000, 2, 11, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60000, 2, 12, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", "", 0, 0, 2, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60000, 2, 13, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60000, 2, 14, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60000, 2, 15, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60000, 2, 16, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60000, 2, 17, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", "", 0, 0, 2, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190804, 60000, 3, 18, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", "", 0, 0, 0, 2, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190804, 60000, 3, 19, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", "", 7, 0, 0, 3, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 101201, 80001, 0, 20, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", "", 1, 0, 0, 1, "ハツネ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 101201, 80001, 0, 21, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", "", 1, 0, 0, 2, "ハツネ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 103801, 80001, 1, 22, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", "", 1, 0, 0, 1, "シオリ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 103801, 80001, 1, 23, "来年も、\n一緒にいられたら…\nうれしいな", "", 1, 0, 0, 2, "シオリ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 103601, 80001, 0, 24, "あなたと一緒にいるようになって、\nもう1年ですか…", "", 2, 0, 0, 1, "キョウカ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 103601, 80001, 0, 25, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", "", 2, 0, 0, 2, "キョウカ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 102001, 80001, 1, 26, "おにいちゃんとあってから、\n1年たったよ～！", "", 2, 0, 0, 1, "ミミ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 102001, 80001, 1, 27, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", "", 2, 0, 0, 2, "ミミ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 100401, 80001, 2, 28, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", "", 2, 0, 0, 1, "ミソギ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 100401, 80001, 2, 29, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", "", 2, 0, 0, 2, "ミソギ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 101001, 80001, 0, 30, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", "", 3, 0, 0, 1, "マホ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 101001, 80001, 0, 31, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", "", 3, 0, 0, 2, "マホ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 104401, 80001, 1, 32, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", "", 3, 0, 0, 1, "イリヤ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 104401, 80001, 1, 33, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", "", 3, 0, 0, 2, "イリヤ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 101701, 80001, 2, 34, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", "", 3, 0, 0, 1, "カオリ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 101701, 80001, 2, 35, "これからも、どうぞよろしく\nお願いするさ～！", "", 3, 0, 0, 2, "カオリ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 102801, 80001, 0, 36, "あんたと出会ってからもうそんなに\nたつのね～", "", 4, 0, 0, 1, "サレン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 102801, 80001, 0, 37, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", "", 4, 0, 0, 2, "サレン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 102501, 80001, 1, 38, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", "", 4, 0, 0, 1, "スズメ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 102501, 80001, 1, 39, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", "", 4, 0, 0, 2, "スズメ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 104601, 80001, 0, 40, "振り返れば、今までいろんなことが\nあったにゃあ…", "", 5, 0, 0, 1, "タマキ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 104601, 80001, 0, 41, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", "", 5, 0, 0, 2, "タマキ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 104801, 80001, 1, 42, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", "", 5, 0, 0, 1, "ミフユ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 104801, 80001, 1, 43, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", "", 5, 0, 0, 2, "ミフユ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 103201, 80001, 0, 44, "あなたさまと出会ってもう1年…", "", 6, 0, 0, 1, "アキノ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 103201, 80001, 0, 45, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", "", 6, 0, 0, 2, "アキノ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 103401, 80001, 1, 46, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", "", 6, 0, 0, 1, "ユカリ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 103401, 80001, 1, 47, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", "", 6, 0, 0, 2, "ユカリ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 107101, 80001, 0, 48, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", "", 7, 0, 0, 1, "クリスティーナ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 107101, 80001, 0, 49, "ともかくこれからも\n愉しませてくれよ☆", "", 7, 0, 0, 2, "クリスティーナ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 104701, 80001, 1, 50, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", "", 7, 0, 0, 1, "ジュン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 104701, 80001, 1, 51, "見えないから分からないって？\nそれもそうだな…", "", 7, 0, 0, 2, "ジュン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 103701, 80001, 0, 52, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", "", 8, 0, 0, 1, "トモ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 103701, 80001, 0, 53, "これからもよろしくね！", "", 8, 0, 0, 2, "トモ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 100501, 80001, 1, 54, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", "", 8, 0, 0, 1, "マツリ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 100501, 80001, 1, 55, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", "", 8, 0, 0, 2, "マツリ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 100701, 80001, 0, 56, "オマエと会って1年なの！\n全然成仏もできなかったし、", "", 9, 0, 0, 1, "ミヤコ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 100701, 80001, 0, 57, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", "", 9, 0, 0, 2, "ミヤコ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 103101, 80001, 1, 58, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", "", 9, 0, 0, 1, "シノブ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 103101, 80001, 1, 59, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", "", 9, 0, 0, 2, "シノブ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 100901, 80001, 0, 60, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", "", 10, 0, 0, 1, "アンナ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 100901, 80001, 0, 61, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", "", 10, 0, 0, 2, "アンナ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 101301, 80001, 1, 62, "君と出会ってもう1年だって！\n早いねー！", "", 10, 0, 0, 1, "ナナカ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 101301, 80001, 1, 63, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", "", 10, 0, 0, 2, "ナナカ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105101, 80001, 0, 64, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", "", 11, 0, 0, 1, "ミツキ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105101, 80001, 0, 65, "これからも、いろんなところを\n調べさせてね？", "", 11, 0, 0, 2, "ミツキ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105601, 80001, 1, 66, "お前さんと出会ってもう1年か\n助太刀するつもりが", "", 11, 0, 0, 1, "ルカ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105601, 80001, 1, 67, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", "", 11, 0, 0, 2, "ルカ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 102701, 80001, 2, 68, "早いものですわね、あなた様と\nお会いして、もう1年…", "", 11, 0, 0, 1, "エリコ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 102701, 80001, 2, 69, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", "", 11, 0, 0, 2, "エリコ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 102301, 80001, 0, 70, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", "", 12, 0, 0, 1, "アヤネ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 102301, 80001, 0, 71, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", "", 12, 0, 0, 2, "アヤネ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 104201, 80001, 1, 72, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", "", 12, 0, 0, 1, "チカ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 104201, 80001, 1, 73, "私のことを見守ってください\nできることなら、ずっと…", "", 12, 0, 0, 2, "チカ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 102101, 80001, 2, 74, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", "", 12, 0, 0, 1, "クルミ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 102101, 80001, 2, 75, "で、でもこれからもずっと…\n一緒にいたいなぁ…", "", 12, 0, 0, 2, "クルミ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 104901, 80001, 0, 76, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", "", 13, 0, 0, 1, "シズル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 104901, 80001, 0, 77, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", "", 13, 0, 0, 2, "シズル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 101101, 80001, 1, 78, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", "", 13, 0, 0, 1, "リノ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 101101, 80001, 1, 79, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", "", 13, 0, 0, 2, "リノ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 100201, 80001, 0, 80, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", "", 14, 0, 0, 1, "ユイ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 100201, 80001, 0, 81, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", "", 14, 0, 0, 2, "ユイ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 100101, 80001, 1, 82, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", "", 14, 0, 0, 1, "ヒヨリ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 100101, 80001, 1, 83, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", "", 14, 0, 0, 2, "ヒヨリ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 100301, 80001, 2, 84, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", "", 14, 0, 0, 1, "レイ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 100301, 80001, 2, 85, "キミに背中を預けられる日が、\n早くきますように", "", 14, 0, 0, 2, "レイ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80001, 0, 86, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", "", 15, 0, 0, 1, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80001, 0, 87, "これからもずっと、覚えていて\nくださいね！", "", 15, 0, 0, 2, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80001, 1, 88, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", "", 15, 0, 0, 1, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80001, 1, 89, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", "", 15, 0, 0, 2, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80001, 2, 90, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", "", 15, 0, 0, 1, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80001, 2, 91, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", "", 15, 0, 0, 2, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 112101, 60001, 1, 92, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", "", 0, 0, 1, 1, "スズメ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, 60001, 2, 93, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, 60001, 2, 94, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, 60001, 2, 95, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, 60001, 2, 96, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, 60001, 2, 97, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", "", 0, 0, 2, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, 60001, 2, 98, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, 60001, 2, 99, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, 60001, 2, 100, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, 60001, 2, 101, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, 60001, 2, 102, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", "", 0, 0, 2, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60001, 2, 103, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60001, 2, 104, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60001, 2, 105, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60001, 2, 106, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60001, 2, 107, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60001, 2, 108, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60001, 2, 109, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", "", 0, 0, 2, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60001, 2, 110, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60001, 2, 111, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60001, 2, 112, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60001, 2, 113, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60001, 2, 114, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60001, 2, 115, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60001, 2, 116, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", "", 0, 0, 2, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 112101, 60001, 3, 117, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", "", 0, 0, 0, 2, "スズメ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 112101, 60001, 3, 118, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", "", 7, 0, 0, 3, "スズメ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 119, "ヒューヒュー♪\nドンドンパフパフー♪", "", 1, 0, 0, 1, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 120, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", "", 1, 0, 0, 1, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 121, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", "", 1, 0, 0, 2, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 122, "え？　ちょっと\nいきなりなにっ？", "", 1, 0, 0, 1, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 123, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", "", 1, 0, 0, 2, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 124, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", "", 1, 0, 0, 2, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 125, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", "", 1, 0, 0, 3, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 126, "ですからその日に向けて\n今から気分を盛り上げているのです", "", 1, 0, 0, 3, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 127, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", "", 1, 0, 0, 3, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 128, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", "", 1, 0, 0, 4, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 129, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", "", 1, 0, 0, 4, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 130, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", "", 1, 0, 0, 4, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 131, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", "", 1, 0, 0, 5, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 132, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", "", 2, 0, 0, 5, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 1, 133, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", "", 2, 0, 0, 1, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 134, "げっ…カリンじゃない\nなんでもないわよ！", "", 2, 0, 0, 6, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 1, 135, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", "", 2, 0, 0, 2, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 136, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", "", 2, 0, 0, 7, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 1, 137, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", "", 2, 0, 0, 3, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 138, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", "", 2, 0, 0, 8, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 139, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", "", 2, 0, 0, 9, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 1, 140, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", "", 2, 0, 0, 4, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 141, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", "", 2, 0, 0, 10, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 1, 142, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", "", 2, 0, 0, 5, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 143, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", "", 2, 0, 0, 11, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 0, 144, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", "", 3, 0, 0, 6, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 1, 145, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", "", 3, 0, 0, 5, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 0, 146, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", "", 3, 0, 0, 7, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 0, 147, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", "", 3, 0, 0, 8, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 1, 148, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", "", 3, 0, 0, 6, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 1, 149, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", "", 3, 0, 0, 7, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 0, 150, "あとは、牧場に素敵な温泉が\n出来たとか…", "", 3, 0, 0, 9, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 1, 151, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", "", 3, 0, 0, 8, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 0, 152, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", "", 3, 0, 0, 10, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 1, 153, "えへへ、ありがとうございます\nコッコロちゃん！", "", 3, 0, 0, 9, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 0, 154, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", "", 3, 0, 0, 11, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 1, 155, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", "", 3, 0, 0, 10, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 156, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", "", 4, 0, 0, 11, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 1, 157, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", "", 4, 0, 0, 12, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 158, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", "", 4, 0, 0, 12, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 1, 159, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", "", 4, 0, 0, 13, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 160, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", "", 4, 0, 0, 13, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 1, 161, "…積極的？\nなんの話よ？", "", 4, 0, 0, 14, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 162, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", "", 4, 0, 0, 14, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 163, "ムーサの町で\nきゃるきゃる～ん☆　って！", "", 4, 0, 0, 15, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 1, 164, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", "", 4, 0, 0, 15, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 165, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", "", 4, 0, 0, 16, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 1, 166, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", "", 4, 0, 0, 16, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 1, 167, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", "", 4, 0, 0, 17, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 168, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", "", 5, 0, 0, 18, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 169, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", "", 5, 0, 0, 12, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 170, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", "", 5, 0, 0, 19, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 171, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", "", 5, 0, 0, 13, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 172, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", "", 5, 0, 0, 20, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 173, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", "", 5, 0, 0, 14, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 174, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", "", 5, 0, 0, 21, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 175, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", "", 5, 0, 0, 15, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 176, "かくし芸？", "", 5, 0, 0, 22, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 177, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", "", 5, 0, 0, 16, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 178, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", "", 5, 0, 0, 23, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 179, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", "", 6, 0, 0, 17, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 180, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", "", 6, 0, 0, 24, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 181, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", "", 6, 0, 0, 17, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 182, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", "", 6, 0, 0, 18, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 183, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", "", 6, 0, 0, 25, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 184, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", "", 6, 0, 0, 18, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 185, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", "", 6, 0, 0, 26, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 186, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", "", 6, 0, 0, 27, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 187, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", "", 6, 0, 0, 28, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 188, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", "", 6, 0, 0, 19, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 189, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", "", 6, 0, 0, 19, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 190, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", "", 6, 0, 0, 29, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 191, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", "", 7, 0, 0, 30, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 192, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", "", 7, 0, 0, 31, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 193, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", "", 7, 0, 0, 32, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 194, "あー\nあー\n…声、これで大丈夫かしら？", "", 7, 0, 0, 33, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 195, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", "", 7, 0, 0, 34, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 196, "オイッスー☆", "", 7, 0, 0, 35, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 197, "……\nいや、ないわ\nいつもどおりが一番ね、うん", "", 7, 0, 0, 36, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 198, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", "", 7, 0, 0, 37, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 199, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", "", 7, 0, 0, 38, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 0, 200, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", "", 8, 0, 0, 20, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 0, 201, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", "", 8, 0, 0, 21, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 0, 202, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", "", 8, 0, 0, 22, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 0, 203, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", "", 8, 0, 0, 23, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 0, 204, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", "", 8, 0, 0, 24, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 0, 205, "オイッスー☆", "", 8, 0, 0, 25, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 0, 206, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", "", 8, 0, 0, 26, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 0, 207, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", "", 8, 0, 0, 27, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 0, 208, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", "", 8, 0, 0, 28, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 209, "オイッスー☆", "", 9, 0, 0, 20, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 210, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", "", 9, 0, 0, 21, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 211, "あと６日で2.5周年ですか…", "", 9, 0, 0, 22, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 212, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", "", 9, 0, 0, 23, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 213, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", "", 9, 0, 0, 24, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 214, "オイッスー☆", "", 9, 0, 0, 25, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 215, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", "", 9, 0, 0, 26, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 216, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", "", 9, 0, 0, 27, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 217, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", "", 9, 0, 0, 28, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 218, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", "", 9, 0, 0, 29, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 219, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", "", 9, 0, 0, 30, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 220, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", "", 10, 0, 0, 31, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 221, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", "", 10, 0, 0, 29, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 222, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", "", 10, 0, 0, 32, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 223, "…………", "", 10, 0, 0, 39, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 224, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", "", 10, 0, 0, 30, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 225, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", "", 10, 0, 0, 40, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 226, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", "", 10, 0, 0, 33, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 227, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", "", 10, 0, 0, 41, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 228, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", "", 10, 0, 0, 34, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 229, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", "", 10, 0, 0, 35, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 230, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", "", 10, 0, 0, 42, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 231, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", "", 10, 0, 0, 31, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 232, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", "", 10, 0, 0, 43, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 233, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", "", 10, 0, 0, 36, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 234, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", "", 11, 0, 0, 6, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 235, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", "", 11, 0, 0, 7, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 236, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", "", 11, 0, 0, 8, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 237, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", "", 11, 0, 0, 9, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 238, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", "", 11, 0, 0, 10, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 239, "次にコッコロさんですが\nこちらは発声練習をしています", "", 11, 0, 0, 11, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 240, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", "", 11, 0, 0, 12, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 241, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", "", 11, 0, 0, 13, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 242, "あれ？\nもしかして緊張で気を失って…？", "", 11, 0, 0, 14, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 243, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", "", 11, 0, 0, 15, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 244, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", "", 11, 0, 0, 16, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 245, "それでは\nまた明日お会いしましょう♪", "", 11, 0, 0, 17, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 246, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", "", 12, 0, 0, 44, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 2, 247, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", "", 12, 0, 0, 37, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 248, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", "", 12, 0, 0, 32, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 249, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", "", 12, 0, 0, 45, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 2, 250, "ひどいですよぉキャルちゃ～ん！", "", 12, 0, 0, 38, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 251, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", "", 12, 0, 0, 33, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 2, 252, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", "", 12, 0, 0, 39, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 0, 253, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", "", 12, 0, 0, 46, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 254, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", "", 12, 0, 0, 34, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 2, 255, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", "", 12, 0, 0, 40, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 256, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", "", 13, 0, 0, 41, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 257, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", "", 13, 0, 0, 47, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 258, "忘れてきちゃいました☆", "", 13, 0, 0, 42, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 259, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", "", 13, 0, 0, 48, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 260, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", "", 13, 0, 0, 35, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 261, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", "", 13, 0, 0, 49, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 262, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", "", 13, 0, 0, 43, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 263, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", "", 13, 0, 0, 50, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 264, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", "", 13, 0, 0, 36, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 265, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", "", 13, 0, 0, 51, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 266, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", "", 13, 0, 0, 37, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 267, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", "", 13, 0, 0, 52, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 268, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", "", 13, 0, 0, 44, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 269, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", "", 13, 0, 0, 38, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 270, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", "", 13, 0, 0, 45, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 271, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", "", 13, 0, 0, 53, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 272, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", "", 13, 0, 0, 46, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 273, "こんにちは\n【ギルド管理協会】のカリンです", "", 14, 0, 0, 18, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 274, "昨日の生放送は\nいかがだったでしょうか？", "", 14, 0, 0, 19, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 275, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", "", 14, 0, 0, 20, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 276, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", "", 14, 0, 0, 21, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 277, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", "", 14, 0, 0, 22, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 278, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", "", 14, 0, 0, 23, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 279, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", "", 14, 0, 0, 24, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 280, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", "", 14, 0, 0, 25, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 281, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", "", 14, 0, 0, 26, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80003, 0, 282, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", "", 14, 0, 0, 27, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 283, "準備はいいですかっ？\n…いっきますよー！", "", 15, 0, 0, 47, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 284, "祝！", "", 15, 0, 0, 54, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 285, "2.5周年！", "", 15, 0, 0, 39, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 286, "おめでとうございま～す☆", "", 15, 0, 0, 48, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 287, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", "", 15, 0, 0, 55, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 288, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", "", 15, 0, 0, 40, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 289, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", "", 15, 0, 0, 49, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 290, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", "", 15, 0, 0, 56, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 291, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", "", 15, 0, 0, 41, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 292, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", "", 15, 0, 0, 57, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 293, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", "", 15, 0, 0, 50, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 294, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", "", 15, 0, 0, 58, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 295, "記念日だから\n平気平気♪\nやばいですね☆", "", 15, 0, 0, 51, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 296, "意味分かんないわよ！", "", 15, 0, 0, 59, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 297, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", "", 15, 0, 0, 42, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 298, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", "", 15, 0, 0, 43, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 299, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", "", 15, 0, 0, 52, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80003, 2, 300, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", "", 15, 0, 0, 60, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80003, 1, 301, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", "", 15, 0, 0, 44, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 302, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", "", 15, 0, 0, 53, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80003, 0, 303, "2.5周年\nありがとうございます！", "105901,45,106001,61", 15, 1, 0, 54, "ペコリーヌ・コッコロ・キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190804, 60002, 1, 304, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", "", 0, 0, 1, 1, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, 60002, 2, 305, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, 60002, 2, 306, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, 60002, 2, 307, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, 60002, 2, 308, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, 60002, 2, 309, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", "", 0, 0, 2, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, 60002, 2, 310, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, 60002, 2, 311, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, 60002, 2, 312, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, 60002, 2, 313, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, 60002, 2, 314, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", "", 0, 0, 2, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60002, 2, 315, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60002, 2, 316, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60002, 2, 317, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60002, 2, 318, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60002, 2, 319, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60002, 2, 320, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60002, 2, 321, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", "", 0, 0, 2, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60002, 2, 322, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60002, 2, 323, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60002, 2, 324, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60002, 2, 325, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60002, 2, 326, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60002, 2, 327, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60002, 2, 328, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", "", 0, 0, 2, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190804, 60002, 3, 329, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", "", 0, 0, 0, 2, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190804, 60002, 3, 330, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", "", 7, 0, 0, 3, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 4, 331, "ささ、シェフィさまはこちらへ…", "", 1, 0, 0, 1, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 0, 332, "コッコロさん、どこへ行くの…？\n…え？", "", 1, 0, 0, 1, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 333, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", "", 1, 0, 0, 1, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 4, 334, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", "", 1, 0, 0, 2, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 0, 335, "ええと…\n二人とも何をしているの？", "", 1, 0, 0, 2, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 1, 336, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", "", 1, 0, 0, 1, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 0, 337, "あの日…？", "", 1, 0, 0, 3, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 338, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", "", 1, 0, 0, 2, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 339, "『プリンセスコネクト！\nRe:Dive』3.5周年！", "", 1, 0, 0, 3, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80005, 2, 340, "やばいですね☆", "", 1, 0, 0, 1, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 1, 341, "って、なにしれっと\n参加してんのよカリン！", "", 1, 0, 0, 2, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80005, 2, 342, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", "", 1, 0, 0, 2, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80005, 2, 343, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", "", 1, 0, 0, 3, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 344, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", "", 1, 0, 0, 4, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 0, 345, "えっ！？　ええとええと…！\nあ、あと14日…！", "", 1, 0, 0, 4, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 346, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", "", 2, 0, 0, 5, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 347, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", "", 2, 0, 0, 3, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 348, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", "", 2, 0, 0, 4, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 349, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", "", 2, 0, 0, 6, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 350, "さすがでございます\nペコリーヌさま", "", 2, 0, 0, 5, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 351, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", "", 2, 0, 0, 3, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 352, "しゃなり、しゃなり…\nふふ、案外できるものね", "", 2, 0, 0, 5, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 353, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", "", 2, 0, 0, 7, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 354, "さ、次はキャルさまの\n番でございますよ", "", 2, 0, 0, 6, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 355, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", "", 2, 0, 0, 4, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 356, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", "", 2, 0, 0, 6, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 357, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", "", 2, 0, 0, 5, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 358, "いたたた…もぉお～！\nなんであたしがこんな目に～！", "", 2, 0, 0, 6, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 359, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", "", 2, 0, 0, 7, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 360, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", "", 2, 0, 0, 7, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 361, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", "", 3, 0, 0, 8, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 362, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", "", 3, 0, 0, 8, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 363, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", "", 3, 0, 0, 9, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 364, "聖学祭…って、なにかしら？", "", 3, 0, 0, 7, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 365, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", "", 3, 0, 0, 10, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 366, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", "", 3, 0, 0, 8, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 367, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", "", 3, 0, 0, 9, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 368, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", "", 3, 0, 0, 9, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 369, "いや、そのまんますぎでしょ…", "", 3, 0, 0, 10, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 370, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", "", 3, 0, 0, 8, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 371, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", "", 3, 0, 0, 10, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 372, "えっ？　ええ…\nぎゅーっ…？", "", 3, 0, 0, 9, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 373, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", "", 4, 0, 0, 11, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 374, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", "", 4, 0, 0, 10, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 375, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", "", 4, 0, 0, 12, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 376, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", "", 4, 0, 0, 11, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 377, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", "", 4, 0, 0, 13, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 378, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", "", 4, 0, 0, 11, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 379, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", "", 4, 0, 0, 14, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 380, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", "", 4, 0, 0, 15, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 381, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", "", 4, 0, 0, 11, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 382, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", "", 4, 0, 0, 12, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 383, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", "", 4, 0, 0, 12, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 384, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", "", 4, 0, 0, 16, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 385, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", "", 4, 0, 0, 12, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 386, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", "", 5, 0, 0, 13, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 387, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", "", 5, 0, 0, 14, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 388, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", "", 5, 0, 0, 15, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 389, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", "", 5, 0, 0, 17, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 390, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", "", 5, 0, 0, 18, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 391, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", "", 5, 0, 0, 13, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 392, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", "", 5, 0, 0, 13, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 393, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", "", 5, 0, 0, 16, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 394, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", "", 5, 0, 0, 19, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 395, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", "", 5, 0, 0, 17, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 396, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", "", 5, 0, 0, 18, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 397, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", "", 5, 0, 0, 19, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80005, 2, 398, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", "", 6, 0, 0, 4, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80005, 2, 399, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", "", 6, 0, 0, 5, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 1, 400, "…えっ！？", "", 6, 0, 0, 20, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 401, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", "", 6, 0, 0, 20, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 0, 402, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", "", 6, 0, 0, 14, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 4, 403, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", "", 6, 0, 0, 14, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 0, 404, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", "", 6, 0, 0, 15, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 1, 405, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", "", 6, 0, 0, 21, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 406, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", "", 6, 0, 0, 21, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 1, 407, "ぶっ殺すぞ！？", "", 6, 0, 0, 22, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80005, 2, 408, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", "", 6, 0, 0, 6, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 409, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", "", 7, 0, 0, 15, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 410, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", "", 7, 0, 0, 23, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 411, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", "", 7, 0, 0, 16, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 412, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", "", 7, 0, 0, 22, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 413, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", "", 7, 0, 0, 24, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 414, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", "", 7, 0, 0, 17, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 415, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", "", 7, 0, 0, 16, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 416, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", "", 7, 0, 0, 18, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 417, "もちろんでございます\n仲良くお勉強いたしましょう", "", 7, 0, 0, 17, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 418, "しれっと教育ママが\n生まれてる…？", "", 7, 0, 0, 25, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 419, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", "", 7, 0, 0, 23, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 420, "え～～～～！？", "", 7, 0, 0, 26, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 421, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", "", 8, 0, 0, 27, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 422, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", "", 8, 0, 0, 19, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 423, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", "", 8, 0, 0, 18, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 424, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", "", 8, 0, 0, 24, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 425, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", "", 8, 0, 0, 20, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 426, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", "", 8, 0, 0, 28, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 427, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", "", 8, 0, 0, 19, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 428, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", "", 8, 0, 0, 21, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 429, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", "", 8, 0, 0, 29, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 430, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", "", 8, 0, 0, 30, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 431, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", "", 8, 0, 0, 25, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 432, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", "", 8, 0, 0, 31, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 0, 433, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", "", 9, 0, 0, 22, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 0, 434, "…えっ？\n生放送の意気込み！？\n突然なに！？", "", 9, 0, 0, 23, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 0, 435, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", "", 9, 0, 0, 24, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 0, 436, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", "", 9, 0, 0, 25, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 0, 437, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", "", 9, 0, 0, 26, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 0, 438, "それから、それから…！\nぅ、ぅぅっ…！", "", 9, 0, 0, 27, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 0, 439, "―びえぇぇ～んっ！！！", "", 9, 0, 0, 28, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 440, "どうされましたか、シェフィさま", "", 9, 0, 0, 20, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 0, 441, "ううっ…ひっく…\nママッ…！", "", 9, 0, 0, 29, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 442, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", "", 9, 0, 0, 21, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 443, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", "", 9, 0, 0, 22, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 0, 444, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", "", 9, 0, 0, 30, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 0, 445, "主さま\n3.5周年まであと５日\nでございます", "", 10, 0, 0, 23, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 0, 446, "ですがその前に\n生放送がありますね", "", 10, 0, 0, 24, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 0, 447, "…生放送に向けた\n意気込みでございますか？", "", 10, 0, 0, 25, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 0, 448, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", "", 10, 0, 0, 26, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 0, 449, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", "", 10, 0, 0, 27, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 0, 450, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", "", 10, 0, 0, 28, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 0, 451, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", "", 10, 0, 0, 29, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 0, 452, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", "", 10, 0, 0, 30, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 0, 453, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", "", 10, 0, 0, 31, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 0, 454, "3.5周年まであと４日！\nやばいですね☆", "", 11, 0, 0, 26, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 1, 455, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", "", 11, 0, 0, 32, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 0, 456, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", "", 11, 0, 0, 27, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 0, 457, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", "", 11, 0, 0, 28, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 0, 458, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", "", 11, 0, 0, 29, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 1, 459, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", "", 11, 0, 0, 33, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 0, 460, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", "", 11, 0, 0, 30, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 0, 461, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", "", 11, 0, 0, 31, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 0, 462, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", "", 11, 0, 0, 32, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 1, 463, "だからあたしはやるなんて一言も…", "", 11, 0, 0, 34, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 0, 464, "オイッスー☆", "", 11, 0, 0, 33, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 1, 465, "聞きなさいっての！！", "", 11, 0, 0, 35, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 466, "3.5周年まであと３日…\nそして生放送は、明日…", "", 12, 0, 0, 31, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 467, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", "", 12, 0, 0, 32, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 468, "おいっす！\n…こうじゃなかったわね\nええと確か…", "", 12, 0, 0, 33, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 469, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", "", 12, 0, 0, 34, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 470, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", "", 12, 0, 0, 35, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 471, "やってますねシェフィちゃん！", "", 12, 0, 0, 34, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 472, "なによ、考えることは\nみんな同じってこと？", "", 12, 0, 0, 36, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 473, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", "", 12, 0, 0, 32, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 474, "みんな…もちろんよ！", "", 12, 0, 0, 36, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 475, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", "", 12, 0, 0, 35, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80005, 2, 476, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", "", 13, 0, 0, 7, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80005, 2, 477, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", "", 13, 0, 0, 8, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 478, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", "", 13, 0, 0, 36, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80005, 2, 479, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", "", 13, 0, 0, 9, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 4, 480, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", "", 13, 0, 0, 33, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80005, 2, 481, "さすが【美食殿】のママですね！\nそしてキャルさんは…", "", 13, 0, 0, 10, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 1, 482, "大丈夫…大丈夫…\nあたしは大丈夫…", "", 13, 0, 0, 37, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80005, 2, 483, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", "", 13, 0, 0, 11, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 0, 484, "あうー？", "", 13, 0, 0, 37, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 4, 485, "あ…", "105901,34,106001,38,190801,12", 13, 1, 0, 37, "みんな");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 1, 486, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", "", 13, 0, 0, 39, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 4, 487, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", "", 13, 0, 0, 35, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 488, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", "", 13, 0, 0, 38, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80005, 2, 489, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", "", 13, 0, 0, 13, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 490, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", "", 14, 0, 0, 38, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 491, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", "", 14, 0, 0, 39, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 492, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", "", 14, 0, 0, 40, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 493, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", "", 14, 0, 0, 36, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 494, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", "", 14, 0, 0, 39, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 495, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", "", 14, 0, 0, 40, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 1, 496, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", "", 14, 0, 0, 37, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 0, 497, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", "", 14, 0, 0, 41, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 498, "へ、へぇ…", "", 14, 0, 0, 40, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 499, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", "", 14, 0, 0, 41, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 500, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", "", 14, 0, 0, 41, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 2, 501, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", "", 14, 0, 0, 42, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 502, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", "", 15, 0, 0, 42, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 1, 503, "祝！", "", 15, 0, 0, 42, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 4, 504, "3.5周年！", "", 15, 0, 0, 38, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 0, 505, "おめでとうございます！", "", 15, 0, 0, 43, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80005, 2, 506, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", "", 15, 0, 0, 14, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190801, 80005, 2, 507, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", "", 15, 0, 0, 15, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 508, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", "", 15, 0, 0, 43, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 509, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", "", 15, 0, 0, 44, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 1, 510, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", "", 15, 0, 0, 43, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106001, 80005, 1, 511, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", "", 15, 0, 0, 44, "キャル");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 0, 512, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", "", 15, 0, 0, 44, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 106401, 80005, 0, 513, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", "", 15, 0, 0, 45, "シェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 4, 514, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", "", 15, 0, 0, 39, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 4, 515, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", "", 15, 0, 0, 40, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105901, 80005, 4, 516, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", "", 15, 0, 0, 41, "コッコロ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 3, 517, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", "", 15, 0, 0, 45, "ペコリーヌ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 105801, 80005, 4, 518, "これからも\nよろしくおねがいします！", "105901,42,106001,45,106401,46,190801,16", 15, 1, 0, 46, "みんな");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 190804, 60003, 1, 519, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", "", 0, 0, 1, 1, "カリン");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, 60003, 2, 520, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, 60003, 2, 521, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, 60003, 2, 522, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, 60003, 2, 523, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, 60003, 2, 524, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", "", 0, 0, 2, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, 60003, 2, 525, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, 60003, 2, 526, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, 60003, 2, 527, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, 60003, 2, 528, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, 60003, 2, 529, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", "", 0, 0, 2, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60003, 2, 530, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60003, 2, 531, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60003, 2, 532, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60003, 2, 533, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60003, 2, 534, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60003, 2, 535, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, 60003, 2, 536, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", "", 0, 0, 2, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60003, 2, 537, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60003, 2, 538, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", "", 0, 0, 1, 0, "");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 0, 60003, 2, 539, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", "", 0, 0, 1, 0, "");
